import React from 'react';
import Image from 'src/images/background.png';
import { COLLATERAL_TOKENS } from "src/config"
import { EarnEntry } from "src/pages/Earn/EarnEntry"; 

import {
  Wrapper,
  Container,
  Title,
  Description,
  CardContainer,
  SecondTitle,
  Flex,
  Button,
  InfoContainer,
  Header,
  Item,
  Background,
} from './EarnStyles';

const Earn = () => {
  return (
    <Wrapper>
      <Container>
        <Title>Earn</Title>
        <Description>Lend assets for the highest yield.</Description>
      </Container>
      <CardContainer>
        <InfoContainer>
          <Header>
            <h2>Pool</h2>
            <h2 className='center'>Projected APY %</h2>
            <h2 className='center'>Total Supply</h2>
            <h2 className='center'>Total Borrow</h2>
            <h2 className='center'>Utilization</h2>
            <h2 className='center'>Balance</h2>
            <div></div>
          </Header>
          {COLLATERAL_TOKENS.map((token) => (
              <EarnEntry key={token.address} token={token}/>
            ))}
        </InfoContainer>
      </CardContainer>
      <Background src={Image} alt='Background Logo' />
    </Wrapper>
  );
};

export default Earn;
